import Login from "../components/auth/Login";

export const routes = [
    {
        path: "/login",
        component: Login,
        label: "Login",
        authentication: false,
        authorization: false
    },
    {
        path: "/",
        component: "",
        label: "Login",
        authentication: true,
        authorization: true
    }
];
